scriptlet.script:
today = new Date();
dd = today.getDate();
mm = today.getMonth()+1; //January is 0!
yyyy = today.getFullYear();

if(dd<10) {
    dd = '0'+dd
} 

if(mm<10) {
    mm = '0'+mm
} 

today = mm + '/' + dd + '/' + yyyy;

// To access the primary output from the operation: 
scriptletContext.put("dateToday",today);
